webpackJsonp([0x7f7557b99301],{373:function(e,i){e.exports={data:{markdownRemark:{html:'<h3>Описание:</h3>\n<p>Беговые дорожки полезны тем, что позволяют продлить молодость. Этот чудесный эффект обеспечивается за счет интенсивного обогащения организма кислородом, которое происходит во время тренировок. Бег на беговой дорожке в определенной ситуации может принести даже больше пользы, чем бег для здоровья на открытом воздухе. Ведь на улице вы не будете бегать с утяжелителями на ногах.</p>\n<h3>Порядок выполнения:</h3>\n<ol>\n    <li>Встаньте на беговую дорожку</li>\n    <li>Выберите подходящий режим (Running, Cardio, manual)</li>\n    <li>Постепенно увеличивайте скорость</li>\n    <li>Постепенно повышайте уровень угла подъема дорожки</li>\n</ol>\n<h3>Советы:</h3>\n<ul>\n    <li>Дышите только носом, в противном случае начнется боль в правом боку</li>\n    <li>Если вы марафонец, высокий темп вам не нужен, тренируйте выносливость</li>\n</ul>\n<h3>Видео-инструкция:</h3>\n<iframe width="100%" height="550rem" src="https://www.youtube.com/embed/oX8j00FgUwQ" frameborder="0" allow="autoplay; encrypted-media" allowfullscreen></iframe>',frontmatter:{path:"/exercise/beg-na-begovoj-dorojke",efficiency:"10",title:"Бег на беговой дорожке",image:"/static/6-00-0.jpg",image_2:"",image_3:"",image_4:"",filterby:"cardio",date:null,injury:"4",bodypart:"Кардио",filtertype:"base",type:"Базовое",filterinventory:"ownweight",inventory:"Собственный вес",filterplace:null}}},pathContext:{}}}});
